import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import LandingPage from "./components/LandingPage";
import LoginPage from "./components/LoginPage";
import RegisterPage from "./components/RegisterPage";
import RentPage from "./components/RentPage";
import ParttimeJob from "./components/ParttimeJob";   // ✅ correct file name
import JobResults from "./components/JobResults";     // ✅ correct file name

import "./style/App.css";

function App() {
  const [user, setUser] = useState(null);

  const handleLogin = (userData) => {
    setUser(userData);
  };

  const handleRegister = (userData) => {
    setUser(userData);
  };

  return (
    <Router>
      <Routes>
        <Route path="/" element={<LandingPage user={user} />} />
        <Route path="/login" element={<LoginPage onLogin={handleLogin} />} />
        <Route
          path="/register"
          element={<RegisterPage onRegister={handleRegister} />}
        />
        <Route path="/rent" element={<RentPage />} />
        <Route path="/parttimejob" element={<ParttimeJob />} />
        <Route path="/jobresults" element={<JobResults />} />
      </Routes>
    </Router>
  );
}

export default App;
